[{'comment_id': 927058506, 'comment_body': 'Not 100% sure about the type here: `std::string::find()` returns `std::string::size_type` and if it is not found, it returns `std::string::npos` which is still a `std::string::size_type`. ', 'comment_created': datetime.datetime(2022, 7, 21, 20, 4, 8, tzinfo=datetime.timezone.utc), 'commenter': 'Viyerelu23333', 'type': 'User'}, {'comment_id': 927063974, 'comment_body': '`-R` option seems to be redundant here.', 'comment_created': datetime.datetime(2022, 7, 21, 20, 12, 9, tzinfo=datetime.timezone.utc), 'commenter': 'Viyerelu23333', 'type': 'User'}, {'comment_id': 927858092, 'comment_body': '```suggestion
    std::string::size_type index = value.find(placeholder);
```', 'comment_created': datetime.datetime(2022, 7, 22, 17, 26, 2, tzinfo=datetime.timezone.utc), 'commenter': 'Viyerelu23333', 'type': 'User'}, {'comment_id': 934519980, 'comment_body': 'Will `system_program` be called more than once during the execution of this program? If yes, then it might be good to define `allowed_system_programs` early on and use the same on every call instead of creating a new json object on every call.', 'comment_created': datetime.datetime(2022, 8, 1, 13, 19, 34, tzinfo=datetime.timezone.utc), 'commenter': 'akshatbatra', 'type': 'User'}, {'comment_id': 934521756, 'comment_body': "Wouldn't it be better to move the creation of `autograding_allowed_commands_default.json` to some Python setup script where `SUBMITTY_INSTALL_DIRECTORY` is defined? That way `replace_placeholder` will not be needed at all.", 'comment_created': datetime.datetime(2022, 8, 1, 13, 21, 22, tzinfo=datetime.timezone.utc), 'commenter': 'akshatbatra', 'type': 'User'}, {'comment_id': 934722856, 'comment_body': "I also had the same idea, but I thought since this is a secure piece of information we wouldn't want a object passing around functions. Not sure about my argument though.", 'comment_created': datetime.datetime(2022, 8, 1, 16, 41, 12, tzinfo=datetime.timezone.utc), 'commenter': 'poorna2152', 'type': 'User'}, {'comment_id': 934723358, 'comment_body': 'Yeah. I could use this [filling_variable_replacement](https://github.com/Submitty/Submitty/blob/main/.setup/INSTALL_SUBMITTY_HELPER.sh#L219). Does that sound good', 'comment_created': datetime.datetime(2022, 8, 1, 16, 41, 55, tzinfo=datetime.timezone.utc), 'commenter': 'poorna2152', 'type': 'User'}, {'comment_id': 934882643, 'comment_body': "That shouldn't be a problem, but this argument is convincing enough to err on the side of caution.", 'comment_created': datetime.datetime(2022, 8, 1, 20, 22, 26, tzinfo=datetime.timezone.utc), 'commenter': 'akshatbatra', 'type': 'User'}, {'comment_id': 936568834, 'comment_body': "Just one more comment considering that this program should be as performant as possible. This loop is encountered only if `allowed_system_programs.contains(program)` returns false, would it be a good idea to wrap the `contains` check above and/or this loop in a conditional such that if `program` contains `/` then we can directly skip to this loop instead of first running `allowed_system_programs.contains(program)`? Because I don't think if `/` is present in `program` then it will be one of the keys in JSON. Thoughts?", 'comment_created': datetime.datetime(2022, 8, 3, 11, 50, 6, tzinfo=datetime.timezone.utc), 'commenter': 'akshatbatra', 'type': 'User'}, {'comment_id': 936620802, 'comment_body': 'If I understand correctly you are suggesting `if (program.length() > 0 && program[0] == "/") ` check right. If that the case that sounds good to me', 'comment_created': datetime.datetime(2022, 8, 3, 12, 47, 40, tzinfo=datetime.timezone.utc), 'commenter': 'poorna2152', 'type': 'User'}, {'comment_id': 936707167, 'comment_body': 'Right, something like:
```
if (program.length() > 0 && program[0] == "/") {
    for (auto& x : allowed_system_programs.items())
    {
        if (x.value() == program) {
           full_path_executable = program;
           return true;
        }
    }
}
else {
    if (allowed_system_programs.contains(program)) {
        full_path_executable = allowed_system_programs[program];
        return true;
    }
}
```', 'comment_created': datetime.datetime(2022, 8, 3, 14, 3, 46, tzinfo=datetime.timezone.utc), 'commenter': 'akshatbatra', 'type': 'User'}, {'comment_id': 936721026, 'comment_body': 'Updated ', 'comment_created': datetime.datetime(2022, 8, 3, 14, 15, 32, tzinfo=datetime.timezone.utc), 'commenter': 'poorna2152', 'type': 'User'}, {'comment_id': 938983531, 'comment_body': "unnecessary complication, don't bother to exclude this file from the rsync. ", 'comment_created': datetime.datetime(2022, 8, 5, 16, 35, 49, tzinfo=datetime.timezone.utc), 'commenter': 'bmcutler', 'type': 'User'}, {'comment_id': 938986983, 'comment_body': 'maybe not in this PR (future PR?)
But it would be good to put this list of commands into the json file(s) as well
Either a separate json with commands for docker containers only, or make the json structure more complex with a boolean per flag about whether it available only inside docker container autograding.  
A more complex json structure would have the benefit of easy extensibility for future features.', 'comment_created': datetime.datetime(2022, 8, 5, 16, 40, 40, tzinfo=datetime.timezone.utc), 'commenter': 'bmcutler', 'type': 'User'}, {'comment_id': 939521714, 'comment_body': '
